import React from 'react';

import { Card, CardHeader, CardBody, CardFooter } from "react-simple-card";
import { Col, Breadcrumb, BreadcrumbItem, Panel } from 'react-bootstrap';

const card = (props) => {
    return (
        <Col xs={12} sm={4}>
            <Panel bsStyle="primary">
                <Panel.Heading>
                    <Panel.Title componentClass="h3">Panel heading</Panel.Title>
                </Panel.Heading>
                <Panel.Body>
                    Panel content
                </Panel.Body>
            </Panel>
        </Col>
    )
};

export default card;
